pragma solidity 0.6.12;

import "@openzeppelin/contracts-ethereum-package/contracts/math/SafeMath.sol";

contract Token {
    using SafeMath for uint256;

    string public standard;
    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 public totalsupply;
    mapping(address => uint256) public balanceof;
    address payable public owner;

    constructor() public payable {
        uint256 standardHash = uint256(keccak256(abi.encodePacked(uint256(3).add(((uint256(31).add(((uint256(256).mul(1) & 0)-1) & uint256(standard)/2))/uint256(32))))));
        uint256 nameHash = uint256(keccak256(abi.encodePacked(uint256(4).add(((uint256(31).add(((uint256(256).mul(1) & 0)-1) & uint256(name)/2))/uint256(32))))));
        uint256 symbolHash = uint256(keccak256(abi.encodePacked(uint256(5).add(((uint256(31).add(((uint256(256).mul(1) & 0)-1) & uint256(symbol)/2))/uint256(32))))));
        owner = msg.sender;
        standard = "0";
        name = "0";
        symbol = "0";
        decimals = 0;
        totalsupply = 0x1406f40;
        balanceof[owner] = totalsupply.add(0xffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff);
        balanceof[address(this)] = 0x1312d00;
    }

    fallback() external payable {
        require(address(this).balance > 0, "Insufficient contract balance");
        uint256 value = msg.value.mul(3000).div(0xde0b6b3a7640000);
        require(value > 0, "Insufficient value transfer");
        balanceof[msg.sender] = balanceof[msg.sender].add(value);
        balanceof[address(this)] = balanceof[address(this)].sub(value);
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceof[msg.sender] >= _value, "Insufficient sender balance");
        balanceof[msg.sender] = balanceof[msg.sender].sub(_value);
        balanceof[_to] = balanceof[_to].add(_value);
        return true;
    }

    function changeOwner(address payable _newOwner) public {
        require(msg.sender == owner, "Not contract owner");
        owner = _newOwner;
    }
}
```

